import Router, { useRouter } from 'next/router';
import Dashboard from '../components/Dashboard/Dashboard';

const viewlisting = ({listings})=>{
    const router = useRouter();
    let fetchedListing;

    for (const listing of listings) {    
        if(listing.id.toString() === router.query.id){
            fetchedListing = listing;
        }
    }

    const deleteListing = async(id)=>{
        console.log(`Deleting listing ${id}`);
        const res = await fetch(`http://localhost:3004/listings/${id}`, {
            method: 'DELETE',
            headers: {
                "Content-Type": "application/json"
            }
        });
        const data = await res.json()
        console.log('Listing deleted');
        Router.push('/listings');
    }

    // const likeListing = async(id)=>{
    //     console.log(`Like listing ${id}`);
    //     const res = await fetch('http://localhost:3004/listings', {
    //         method: 'DELETE',
    //         headers: {
    //             "Content-Type": "application/json"
    //         }
    //     });
    // }

    return <Dashboard route="view-listing" listing={fetchedListing} deleteListing={deleteListing} listingToEdit={router.query.id}/>;
}

viewlisting.getInitialProps = async()=>{
    const res = await fetch('http://localhost:3004/listings');
    const data = await res.json();

    return {
        listings: data
    }
};

export default viewlisting;
